import React from "react";
import { HeartTwoTone } from "@ant-design/icons";
import "antd/dist/antd.css";
import { Row, Col } from "antd";

class ShowFull extends React.Component {
  render() {
    return (
      <>
        <div
          style={{
            fontSize: "18px",
            padding: "5px 0",
            width: "300px",
            borderRadius: "15px 15px 0 0",
            backgroundColor: "#00000025",
          }}
        >
          Chung ta da ben nhau...
        </div>
        <div
          style={{
            padding: "2px 0",
            width: "300px",
            backgroundColor: "#00000010",
          }}
        ></div>
        <div
          style={{
            height: "100px",
            width: "300px",
            borderRadius: "0px 0px 15px 15px",
            backgroundColor: "#00000025",
          }}
        >
          <div style={{ width: "100%" }}>
            <HeartTwoTone
              twoToneColor="#e69915"
              style={{ fontSize: "35px", padding: "10px 3px 5px 3px" }}
            />
            <HeartTwoTone
              twoToneColor="#e69915"
              style={{ fontSize: "35px", padding: "10px 3px 5px 3px" }}
            />
            <HeartTwoTone
              twoToneColor="#e69915"
              style={{ fontSize: "35px", padding: "10px 3px 5px 3px" }}
            />
            <HeartTwoTone
              twoToneColor="#e69915"
              style={{ fontSize: "35px", padding: "10px 3px 5px 3px" }}
            />
            <HeartTwoTone
              twoToneColor="#e69915"
              style={{ fontSize: "35px", padding: "10px 3px 5px 3px" }}
            />
            <HeartTwoTone
              twoToneColor="#e69915"
              style={{ fontSize: "35px", padding: "10px 3px 5px 3px" }}
            />
            <HeartTwoTone
              twoToneColor="#e69915"
              style={{ fontSize: "35px", padding: "10px 3px 5px 3px" }}
            />
          </div>
          <Row style={{ width: "90%" }}>
            <Col span={4}>năm</Col>
            <Col span={3}>tháng</Col>
            <Col span={3}>tuần</Col>
            <Col span={4}>ngày</Col>
            <Col span={3}>giờ</Col>
            <Col span={3}>phút</Col>
            <Col span={3}>giây</Col>
          </Row>
        </div>
      </>
    );
  }
}

export default ShowFull;
